note_models.css:
.card {
	font-family: Helvetica;
	font-size: 20px;
	text-align: center;
	color: black;
	margin:0px;
	padding-top: 20px;
}
.imageWrapper {
	position: relative;
	padding:0;
	margin:0;
	min-width: 100vw;
}
.imageOverlay {
	position: absolute;
	//padding:0;
	//margin:0;
	top: 0;
	left: 0;
	min-width: 100vw;
}
.Gebirge{
}
.android .card{
	height: 97vh;
}
.android .imageWrapper {
	margin0;
	padding:0;
	min-width:95vw;
	min-height:40vh;
}
.android .imageOverlay {
	margin:0;
	padding:0;	
	object-fit: contain;
	min-width:95vw;
	min-height:61vw;
}

